@AfterClass
public static void cleanUp() throws Exception {
  IOUtils.closeQuietly(solrScraper);
  IOUtils.closeQuietly(solrClient);
  cleanUpHarness();
  executor.shutdownNow();
  jetty.stop();
}

@AfterClass
public static void cleanUp() throws Exception {
  IOUtils.closeQuietly(solrScraper);
  IOUtils.closeQuietly(solrClient);
  cleanUpHarness();
  if (null != executor) {
    executor.shutdownNow();
    executor = null;
  }
  if (null != jetty) {
    jetty.stop();
    jetty = null;
  }
}

